INSERT INTO `works` (`id_works`, `description`, `title`, `difficulty`, `time`, `file`, `type`, `noteText`, `id_pr`, `HaveSolut`, `date`, `HaveFile`, `solutName`, `fileName`, `solution`, `solutPath`, `filePath`) VALUES
(1, 'Поприветствуйте пользователя (желтым цветом). Попросите некоторый текст не менее 5 слов (проверка обязательна). Произведите подсчет общего количества гласных или согласных в тексте. \r\nОбщее количество гласных в строке: 9 \r\nОбщее количество согласных в строке: 12 Уточните хочет ли пользователь продолжить (да/нет). \r\nЕсли да - возвращаемся к началу программы «Выберите задачу:», если нет - происходит закрытие программы ', 'Задача 1 ', '1 уровень', 15, , 'Решение задачи', 'Проверить правильность обработки исключений и ошибок в  коде.', 1, '', '04.10.2024', '', '', 'blog-Python-850x280.png', '', NULL, 'http://cd00351.tw1.ru/php/uploads/blog-Python-850x280.png');
INSERT INTO `works` (`id_works`, `description`, `title`, `difficulty`, `time`, `file`, `type`, `noteText`, `id_pr`, `HaveSolut`, `date`, `HaveFile`, `solutName`, `fileName`, `solution`, `solutPath`, `filePath`) VALUES
(2, 'Поприветствуйте пользователя (желтым цветом). Попросите ввести минимальное И максимальное число и количество элементов в рандомно генерируемом массиве (проверка обязательна). Произведите подсчет общего количества повторяющихся элементов в массиве, которые будут сохранены в массиве: 2. Также найдите максимальный и минимальный элемент в массиве \nУточните хочет ли пользователь продолжить (да/нет). Если да возвращаемся к началу программы «Выберите задачу:», если нет - происходит закрытие', 'Задача 2 ', '3 уровень', 90, , 'Решение задачи', 'Проверить скорость выполнения кода', 1, 'Да', '14.10.2024', 'Да', 'Dima Krasikov.accdb', 'vzq17al9 (3).csv', , 'http://cd00351.tw1.ru/php/uploads/Dima Krasikov.accdb', 'http://cd00351.tw1.ru/php/uploads/vzq17al9 (3).csv');
INSERT INTO `works` (`id_works`, `description`, `title`, `difficulty`, `time`, `file`, `type`, `noteText`, `id_pr`, `HaveSolut`, `date`, `HaveFile`, `solutName`, `fileName`, `solution`, `solutPath`, `filePath`) VALUES
(3, 'Поприветствуйте пользователя. Попросите ввести некоторый текст не менее 7 слов (проверка обязательна). Произведите сортировку массива строк в порядке возрастания (по словам). Результат выведите на экран с надписью: «Сортированный массив». Уточните хочет ли пользователь продолжить (да/нет). \nЕсли да - возвращаемся к началу программы «Выберите задачу:», если нет - происходит закрытие программы ', 'Задача 3 ', '1 уровень', 30, , 'Решение задачи', 'Убедится, что код написан в едином стиле и отформатирован правильно.', 1, 'Да', '04.11.2024', 'Да', 'cd00351_ekz.sql', 'Answers.docx', , 'http://cd00351.tw1.ru/php/uploads/cd00351_ekz.sql', 'http://cd00351.tw1.ru/php/uploads/Answers.docx');
INSERT INTO `works` (`id_works`, `description`, `title`, `difficulty`, `time`, `file`, `type`, `noteText`, `id_pr`, `HaveSolut`, `date`, `HaveFile`, `solutName`, `fileName`, `solution`, `solutPath`, `filePath`) VALUES
(4, 'Поприветствуйте пользователя (желтым цветом).\nПриведены значения температуры воздуха за 4 дня; значения взяты с трех метеостанций,расположенных в разных регионах страны:\n| Номер станции| 1-й день| 2-й день|3-й день| 4-й день|\n|--------|--------|--------|--------|--------|\n| 1| -8|7| 3|0|\n| 2| 5|3| 1|2|\n| 3| 6|-8| -1|3|\n\nВдвумерном массиве это выглядело бы \"n\" так:\n1[0,0]=-8; t[0,1]=-14;\nt[0,2]=-19;t[0,3]-18;\nt[1,0]=25;t[1,1]-28;\nt[1,2]=26;t[1,3]=20;\nt[2,0]=11;t[2,1]-18;\nt[2,2]=20;\nt[2,3]-25;\nВыполнить:\n1) Выведите красным цветом значение температуры на 2-й метеостанции в течение 4-го дня и на 3-й метеостанции в течение 1-го дняРезультат:\n«Температура 2-й метеостанции на 4-й день: 20»«Температура 3-й метеостанции на 1-й день: 11».\n2) Попросите пользователя выбрать метеостанцию и выбрать день. Выведите синим цветом значение температуры на выбранной метеостанции в течение выбранного дня.Результат:\n«Температура N-й метеостанции на N-й день: 20»значения цветом\nтемпературы всех 3) Попросите пользователя выбрать день. Выведите зеленым метеостанций в течение выбранного дня (необходим fоr цикл). «Температура всех метеостанций на N-й день: п, п.п.п⟫ 4) Попросите пользователя желает ли он вывести все данные. Если он ответит «ДА». Выведите зеленым цветом значения температуры всех метеостанций в течение всех дней.5) Попросите пользователя выбрать метеостанцию и рассчитайте среднюю температуру на метеостанции температуры. «Средняя температура (необходим fоr цикла).. Выведите синим метеостанции: 20»\nцветом значениеУточните хочет ли пользователь продолжить (да/нет). Если да «Выберите задачу:», если нет происходит закрытие программы\nN-й- возвращаемся к началу программы\n', 'Задача 4 ', '1 уровень', 45, , 'Решение задачи', 'Проверить решение на обработку пробелов и пустых строк', 1, 'Да', '01.10.2024', 'Да', 'cosmetics.sql', 'Пример ТЗ по ГОСТу.docx', '', 'http://cd00351.tw1.ru/php/uploads/cosmetics.sql', 'http://cd00351.tw1.ru/php/uploads/Пример ТЗ по ГОСТу.docx');
INSERT INTO `works` (`id_works`, `description`, `title`, `difficulty`, `time`, `file`, `type`, `noteText`, `id_pr`, `HaveSolut`, `date`, `HaveFile`, `solutName`, `fileName`, `solution`, `solutPath`, `filePath`) VALUES
(6, 'Напишите функцию sortByAge(users), которая принимает массив объектов со свойством age и сортирует их по нему.\n```javascript\nlet vasya = { name: \"Вася\", age: 25 };\nlet petya = { name: \"Петя\", age: 30 };\nlet masha = { name: \"Маша\", age: 28 };\n\nlet arr = [ vasya, petya, masha ];\n\nsortByAge(arr);\n\n// теперь: [vasya, masha, petya]\nalert(arr[0].name); // Вася\nalert(arr[1].name); // Маша\nalert(arr[2].name); // Петя\n```', 'Отсортировать пользователей по возрасту', '5 уровень', 60, NULL, 'Решение задачи', 'Проверить скорость выполнения кода', 4, '', '04.06.2023', '', '', '', '', NULL, NULL),
(10, 'Отсортируйте массив в порядке убывания.\n```javascript\nlet arr = [5, 2, 1, -10, 8];\n\n// ... ваш код для сортировки по убыванию\n\nalert( arr ); // 8, 5, 2, 1, -10\n```', 'Сортировать в порядке по убыванию', '4 уровень', 60, NULL, 'Решение задачи', 'Проверить решение на наличие комментариев', 4, '', '12.10.2024', '', '', '', '', NULL, NULL),
(14, '# Методы массивов\nМассивы предоставляют множество методов. Чтобы было проще, в этой главе они разбиты на группы.\n\nДобавление/удаление элементов\nМы уже знаем методы, которые добавляют и удаляют элементы из начала или конца:\n\n- `arr.push(...items)` – добавляет элементы в конец\n- ` arr.pop()` – извлекает элемент из конца,\n- `arr.shift(`) – извлекает элемент из начала,\n- `arr.unshift(...items)` – добавляет элементы в начало.\n\nЕсть и другие.\n\n## **splice**\n\nКак удалить элемент из массива?\n\nТак как массивы – это объекты, то можно попробовать delete:\n\n```javascript\nlet arr = [\"I\", \"go\", \"home\"];\n\ndelete arr[1]; // удалить \"go\"\n\nalert( arr[1] ); // undefined\n\n// теперь arr = [\"I\",  , \"home\"];\nalert( arr.length ); // 3\n```\nЭлемент был удалён, но в массиве всё ещё три элемента, мы можем увидеть, что `arr.length == 3.`\n\nЭто естественно, потому что `delete obj.key` удаляет значение по ключу` key.` Это всё, что он делает. Хорошо для объектов. Но для массивов мы обычно хотим, чтобы оставшиеся элементы сдвинулись и заняли освободившееся место. Мы ждём, что массив станет короче.\n\nПоэтому нужно использовать специальные методы.\n\nМетод `arr.splice` – это универсальный «швейцарский нож» для работы с массивами. Умеет всё: добавлять, удалять и заменять элементы.\n\nСинтаксис:\n\n```javascript\narr.splice(start[, deleteCount, elem1, ..., elemN])\n```\n\nОн изменяет `arr `начиная с индекса` start`: удаляет `deleteCount `элементов и затем вставляет `elem1, ..., elemN `на их место. Возвращает массив из удалённых элементов.\n\nЭтот метод легко понять, рассмотрев примеры.\n\nНачнём с удаления:\n\n```javascript\nlet arr = [\"Я\", \"изучаю\", \"JavaScript\"];\n\narr.splice(1, 1); // начиная с индекса 1, удалить 1 элемент\n\nalert( arr ); // осталось [\"Я\", \"JavaScript\"]\n```\nЛегко, правда? Начиная с индекса 1, он убрал 1 элемент.\n\nВ следующем примере мы удалим 3 элемента и заменим их двумя другими.\n\n```javascript\nlet arr = [\"Я\", \"изучаю\", \"JavaScript\", \"прямо\", \"сейчас\"];\n\n// удалить 3 первых элемента и заменить их другими\narr.splice(0, 3, \"Давай\", \"танцевать\");\n\nalert( arr ) // теперь [\"Давай\", \"танцевать\", \"прямо\", \"сейчас\"]\n```\nЗдесь видно, что `splice` возвращает массив из удалённых элементов:\n\n```javascript\nlet arr = [\"Я\", \"изучаю\", \"JavaScript\", \"прямо\", \"сейчас\"];\n\n// удалить 2 первых элемента\nlet removed = arr.splice(0, 2);\n\nalert( removed ); // \"Я\", \"изучаю\" <-- массив из удалённых элементов\n```\nМетод` splice `также может вставлять элементы без удаления, для этого достаточно установить `deleteCoun`t в `0`:\n\n```javascript\nlet arr = [\"Я\", \"изучаю\", \"JavaScript\"];\n\n// с индекса 2\n// удалить 0 элементов\n// вставить \"сложный\", \"язык\"\narr.splice(2, 0, \"сложный\", \"язык\");\n\nalert( arr ); // \"Я\", \"изучаю\", \"сложный\", \"язык\", \"JavaScript\"\n```\n**Отрицательные индексы разрешены**\n\nВ этом и в других методах массива допускается использование отрицательных индексов. Они определяют позицию с конца массива, как тут:\n\n```javascript\nlet arr = [1, 2, 5];\n\n// начиная с индекса -1 (перед последним элементом)\n// удалить 0 элементов,\n// затем вставить числа 3 и 4\narr.splice(-1, 0, 3, 4);\n\nalert( arr ); // 1,2,3,4,5\n```\n**slice**\nМетод arr.slice намного проще, чем похожий на него arr.splice.\n\n**Синтаксис:**\n\n`arr.slice([start], [end])`\nОн возвращает новый массив, в который копирует все элементы с индекса start до end (не включая end). start и end могут быть отрицательными, в этом случае отсчёт позиции будет вестись с конца массива.\n\nЭто похоже на строковый метод str.slice, но вместо подстрок возвращает подмассивы.\n\n**Например:**\n\n```javascript\nlet arr = [\"t\", \"e\", \"s\", \"t\"];\n\nalert( arr.slice(1, 3) ); // e,s (копирует с 1 до 3)\n\nalert( arr.slice(-2) ); // s,t (копирует с -2 до конца)\n```\nМожно вызвать slice без аргументов: arr.slice() создаёт копию arr. Это часто используют, чтобы создать копию массива для дальнейших преобразований, которые не должны менять исходный массив.\n\n**concat**\nМетод arr.concat создаёт новый массив, в который копирует данные из других массивов и дополнительные значения.\n\n**Синтаксис:**\n\narr.concat(arg1, arg2...)\nОн принимает любое количество аргументов, которые могут быть как массивами, так и простыми значениями.\n\nВ результате – новый массив, включающий в себя элементы из arr, затем arg1, arg2 и так далее.\n\nЕсли аргумент argN – массив, то копируются все его элементы. Иначе копируется сам аргумент.\n\n**Например:**\n\n```javascript\nlet arr = [1, 2];\n\n// создать массив из: arr и [3,4]\nalert( arr.concat([3, 4]) ); // 1,2,3,4\n\n// создать массив из: arr и [3,4] и [5,6]\nalert( arr.concat([3, 4], [5, 6]) ); // 1,2,3,4,5,6\n\n// создать массив из: arr и [3,4], потом добавить значения 5 и 6\nalert( arr.concat([3, 4], 5, 6) ); // 1,2,3,4,5,6\n```\nОбычно он копирует только элементы из массивов. Другие объекты, даже если они выглядят как массивы, добавляются как есть:\n\n```javascript\nlet arr = [1, 2];\n\nlet arrayLike = {\n  0: \"что-то\",\n  length: 1\n};\n\nalert( arr.concat(arrayLike) ); // 1,2,[object Object]\n```\n…Но если массивоподобный объект имеет специальное свойство Symbol.isConcatSpreadable, то он обрабатывается как массив, с помощью concat: вместо него добавляются его элементы:\n\n```javascript\nlet arr = [1, 2];\n\nlet arrayLike = {\n  0: \"что-то\",\n  1: \"ещё\",\n  [Symbol.isConcatSpreadable]: true,\n  length: 2\n};\n\nalert( arr.concat(arrayLike) ); // 1,2,что-то,ещё\n```\nПеребор:` forEach`  \nМетод `arr.forEach` позволяет запускать функцию для каждого элемента массива.\n\n**Синтаксис:**\n\n```javascript\narr.forEach(function(item, index, array) {\n  // ... делать что-то с item\n});\n```\n', 'Лекция \'Методы массивов\'', '3 уровень', 45, NULL, 'Решение задачи', 'Проверить правильность обработки исключений и ошибок в  коде.', 4, '', '21.11.2024', '', '', '', '', NULL, NULL),
